import './App.css';
import 'antd/dist/antd.css'
import { Layout, Menu, Breadcrumb } from 'antd';

const { Header, Content, Footer } = Layout;

function App() {
  return (
    <Layout>
    <Header style={{  zIndex: 1, width: '100%',background:"white" }}>


      </Header>

    <Content className="site-layout" >
      <Breadcrumb style={{ margin: '16px 48px' }}>
        <Breadcrumb.Item>หน้าแรก</Breadcrumb.Item>
        <Breadcrumb.Item>ค้นหา</Breadcrumb.Item>
        </Breadcrumb>
        </Content>
        <Content className="site-layout" style={{ padding: '0 50px', marginTop: 10 }}>
      <div className="site-layout-background" style={{ padding: 8, minHeight: 2080 }}>
          <h3>
            ผลการค้นหา ทั้งหมด
      </h3>
      </div>
    </Content>
    <Footer style={{ textAlign: 'center' }}>Ant Design ©2018 Created by Ant UED</Footer>
  </Layout>
  );
}

export default App;
